class Solution2482{
    public int[][] onesMinusZeros(int[][] grid) {
    	//step 1, populate ones count array for row and col
    	int width = grid[0].length;
    	int height = grid.length;
    	int[] onesCntForRow = new int[height];
    	int[] onesCntForCol = new int[width];
    	for (int i=0; i<height; i++) {
    		for (int j=0; j<width; j++) {
    			if (grid[i][j]==1) {
    				onesCntForRow[i]++;
    				onesCntForCol[j]++;
    			}//fi    			
    		}//rof
    	}//rof
    	
    	//step 2, generate diff matrix according to ones count arrays
    	int halfCircum = height+width;
    	for (int i=0; i<height; i++) {
    		for (int j=0; j<width; j++) {
    			grid[i][j] = onesCntForRow[i]*2+onesCntForCol[j]*2-halfCircum;	
    		}//rof
    	}//rof
        return grid;
    }//end method
}// end class

